import { hotelConsts } from '../actions/HotelAction'

const initialState = {
  items: []
}

const HotelReducer = (state = initialState, action) => {
  switch (action.type) {
    case newsletterConsts.RESET_ITEMS:
      return initialState;
    case newsletterConsts.ITEMS:
      return {
        ...state,
        ...action.items
      }
    default:
      return state;
  }
}

export default HotelReducer;
